The electromagnetic compatibility of the flight controller and GPS system needs to consider the matching and compatibility with the unmanned aircraft system, and should meet:
Radiation harassment shall meet the requirements of Class A in GB/T9254 a 2008;
Electrostatic discharge immunity shall comply with GB/T17618 a 2015;
Radio frequency electromagnetic field radiation immunity shall meet GB/T17618 a 2015.

